import React from 'react';
import { Form, Input, Checkbox, Button, Radio, Switch } from 'antd';
import { UserOutlined, LockOutlined } from '@ant-design/icons';

const MyForm: React.FC = () => {
  const onFinish = (values: any) => {
    console.log('Received values:', values);
  };



  return (
    <div className="form-container">
      <Form name="form-1" initialValues={{ remember: true }} onFinish={onFinish}>
        <div className="form-content">
          <Form.Item name="username" rules={[{ required: true, message: 'Please input your username!' }]}>
            <Input placeholder="Enter username" />
          </Form.Item>

          <Form.Item name="password" rules={[{ required: true, message: 'Please input your password!' }]}>
            <Input.Password placeholder="Enter password" />
          </Form.Item>

          <Form.Item name="inputText" rules={[{ required: true, message: 'Please input text!' }]}>
            <Input placeholder="Input text" />
          </Form.Item>

          <Form.Item name="remember" valuePropName="checked">
            <Checkbox>Remember Me</Checkbox>
          </Form.Item>

          <Form.Item name="switch" valuePropName="checked">
            <Switch checkedChildren="On" unCheckedChildren="Off" />
          </Form.Item>

          <Form.Item name="radio">
            <Radio.Group>
              {[1, 2, 3].map(option => (
                <Radio key={option} value={`option${option}`}>Radio selection {option}</Radio>
              ))}
            </Radio.Group>
          </Form.Item>

          <Form.Item name="dropdown">
            <Input placeholder="Dropdown Option" readOnly />
            <div className="optionDropDown" id="optionDropDown">
              {['Dropdown Option', 'Dropdown Option 1', 'Dropdown Option 2'].map(option => (
                <div>{option}</div>
              ))}
            </div>
          </Form.Item>

          <Form.Item>
            <Button type="primary" htmlType="submit">
              Next
            </Button>
            <Button type="default" htmlType="button">
              Cancel
            </Button>
          </Form.Item>
        </div>
      </Form>
    </div>
  );
};

export default MyForm;
